//Script for Available Super Channels list to expand and collapse

$(document).ready(function(){
	
        $("li.show-more-news").click(function () {
				$(".more-news").toggle();
				var originalContent = $(this).html();
    			$(this).html(originalContent == '<div class="less-arrow">Show less</div>' ? '<div class="more-arrow">Show more</div>' : '<div class="less-arrow">Show less</div>');
			});
			
			 $("li.show-more-lifestyle").click(function () {
				$(".more-lifestyle").toggle();
				var originalContent = $(this).html();
    			$(this).html(originalContent == '<div class="less-arrow">Show less</div>' ? '<div class="more-arrow">Show more</div>' : '<div class="less-arrow">Show less</div>');
			});
			
			 $("li.show-more-entertainment").click(function () {
				$(".more-entertainment").toggle();
				var originalContent = $(this).html();
    			$(this).html(originalContent == '<div class="less-arrow">Show less</div>' ? '<div class="more-arrow">Show more</div>' : '<div class="less-arrow">Show less</div>');
			});
			
			 $("li.show-more-audience").click(function () {
				$(".more-audience").toggle();
				var originalContent = $(this).html();
    			$(this).html(originalContent == '<div class="less-arrow">Show less</div>' ? '<div class="more-arrow">Show more</div>' : '<div class="less-arrow">Show less</div>');
			});

// blog archive			
 // init: collapse all groups except for the first one
 $(".blog-archive-block ul").each(function(i)
 {
  if (i==0) $(this).siblings("h3").children(".collapse-icon").text("▼");
  else $(this).hide();
 });
  
 // click event: toggle visibility of group clicked (and update icon)
 $(".blog-archive-block h3").click(function()
 {
  var icon = $(this).children(".collapse-icon");
  $(this).siblings("ul").slideToggle(function()
  {
   (icon.text()=="▼") ? icon.text("►") : icon.text("▼");
  });
 });






});

